import UIKit

class HunddataDog {
    let dogSingleURL: NSURL = NSURL(string: "https://hundar.skk.se/hunddata/Hund.aspx")!
    
    var randomID: NSString?
    var dogName: NSString?
    var regnr: NSString?
    var morName: NSString?
    
    init() {
    }
    
    func fetch(callback: () -> Void) {
        
        var request = NSMutableURLRequest(URL: self.dogSingleURL)
        var session = NSURLSession.sharedSession()
        request.HTTPMethod = "POST"
        
        request.setValue("https://hundar.skk.se/hunddata/wrapper.aspx?hundid=" + self.randomID! + "&sida=Hund", forHTTPHeaderField: "Referer")
        
        request.HTTPBody = ("hundid=" + self.randomID! + "&tillfalle=&raskod=&domarnr=&year=&manad=&typkod=&tavlingsort=&lista=&personid=&knapp=&caller=&sourceappid=").dataUsingEncoding(NSUTF8StringEncoding)
        
        var task = session.dataTaskWithRequest(request, completionHandler: {data, response, error -> Void in
            // Convert NSData to NSString
            var strData: NSString = NSString(data: data, encoding: NSUTF8StringEncoding)!
            println(response)
            println(strData)
            
            self.extractMorValue(strData)
            
            callback()
        })
        
        task.resume()
        
    }
    
    private func extractMorValue(data: NSString) {
        // Mor Value
        let startRange: NSRange = data.rangeOfString("<span id=\"lblMornamn\" class=\"datatext\">")
        
        let workdata = data.substringFromIndex(startRange.location + startRange.length) as NSString
        
        let endRange: NSRange = workdata.rangeOfString("</span>")
        self.morName = workdata.substringToIndex(endRange.location)
    }
}

class Hunddata {
    
    let dogURL: NSURL = NSURL(string: "https://hundar.skk.se/hunddata/Hund_sok.aspx")!
    
    var isReady = false
    var notReadyQueue = Array<() -> Void>()
    
    init() {
        println("Init Hunddata")
        var request = NSMutableURLRequest(URL: self.dogURL)
        var session = NSURLSession.sharedSession()
        request.HTTPMethod = "POST"
        
        var task = session.dataTaskWithRequest(request, completionHandler: {data, response, error -> Void in
            self.isReady = true
            
            for work in self.notReadyQueue {
                work()
            }
        })
        
        task.resume()
    }
    
    func ready(callback: () -> Void) {
        if isReady {
            callback()
        } else {
            notReadyQueue.append(callback)
        }
    }
    
