    private func parseDogsTr(data: NSString) -> Array<HunddataDog> {
        var workData = data
        println("Entering parseDogTr")
        var trs = Array<HunddataDog>()
        
        // Parse one <tr> at the time
        while let indexRange = workData.rangeOfString("<tr align=\"left\" bgcolor=\"White\">") as NSRange? {
            if indexRange.location != NSNotFound {
                let tr: NSString = workData.substringFromIndex(indexRange.location + indexRange.length)
                let trIndexRange: NSRange = tr.rangeOfString("</tr>")
                let tr2 = tr.substringToIndex(trIndexRange.location)
                workData = workData.substringFromIndex(tr2.utf16Count)
                
                trs.append(self.parseDogsTd(tr2))
            } else {
                break
            }
        }
        
        return trs
    }

    private func parseDogsTd(data: NSString) -> HunddataDog {
        var dog = HunddataDog()
        
        // dog random id
        let workdata: NSString = data.substringFromIndex(79)
        let range: NSRange = workdata.rangeOfString("&")
        let randomID = workdata.substringToIndex(range.location)
        dog.randomID = randomID
        
        // Regnr
        let startRange: NSRange = data.rangeOfString("&#39;&#39;)\">")
        let endRange: NSRange = data.rangeOfString("</a>")
        let regnr = (data.substringFromIndex(startRange.location + startRange.length) as NSString).substringToIndex(endRange.location - (startRange.location + startRange.length))
        dog.regnr = regnr
        
        // Namn
        println(data)
        let startRangeNamn: NSRange = data.rangeOfString("td class=\"datatext\" bgcolor=\"White\">")
        let workdataNamn = data.substringFromIndex(startRangeNamn.location + startRangeNamn.length) as NSString
        let endRangeNamn: NSRange = workdataNamn.rangeOfString("</td>")
        dog.dogName = workdataNamn.substringToIndex(endRangeNamn.location)
        
        
        // TODO: parse other columns in table
        
        return dog
    }

